import imageRickMorty from './img/rick-morty.png';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
       <h1 className="title">Rick & Morty</h1>
       <img src={imageRickMorty} alt="Rick & Morty" className="img-home" />
       <button></button>
      </header>
    </div>
  );
}

export default App;
